// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract RateCaculator {
    struct Loan {
        address borrower;
        address loanToken;
        uint256 loanAmount;
        address collateralToken;
        uint256 collateralAmount;
        bool isActive;
    }

    struct Deposit {
        uint256 time;
        uint256 amount;
    }

    mapping(address => mapping(address => Deposit)) public deposits; // 用户存款 (代币地址 => (用户地址 => 存款))
    mapping(address => Deposit) public eth_deposits; // 用户 ETH 存款 (用户地址 => 存款)
    mapping(address => Loan[]) public loans; // 用户贷款信息 (用户地址 => 贷款数组)

    function getCurrentTimeView() internal view returns (uint256) {
        return block.timestamp;
    }

    // function updateAmountByRates(uint256 rate, mapping(address => Deposit) storageInfo) internal {
    //     // 获取当前时间戳
    //     uint256 currentTime = getCurrentTimeView();

    //     // 获取用户的存储信息
    //     Deposit storage userDeposit = storageInfo[msg.sender];

    //     // 计算时间差（以秒为单位）
    //     uint256 timeDiff = currentTime - userDeposit.time;

    //     // 计算利息
    //     uint256 interest = (userDeposit.amount * rate * timeDiff) / (100 * 365 days);

    //     // 更新存储金额
    //     userDeposit.amount += interest;

    //     // 更新上次更新时间
    //     userDeposit.time = currentTime;
    // }
}

